import React, { Component } from 'react';
import './App.css';

function Header(props){
  return <h1>Erica's Shoppi</h1>
}


class App extends Component {
  render() {
    const cartItems = [
      {name:'iPhone', count: 3, price: 3000},
      {name:'iPad', count: 2, price: 1600},
      {name:'AirPods', count: 4, price: 1000}
    ];

    return (
      <div className="App">
        <Header />
        <Cart cartItems={cartItems}/>
        <Footer total={cartItems.reduce((a,c) => (a + c.price * c.count), 0)} />
      </div>
    )
  }

}


export default App;
